import React from "react";

let Pagination = () => {
    return (
        <>
            < div div className="col-12 pagination d-flex justify-content-center" >
                <ul className="pages">
                    <li>&lt;</li>
                    <li >1</li>
                    <li>2</li>
                    <li>3</li>
                    <li>4</li>
                    <li className="btn" value={+1} onClick={(event) => setFilterData(event, 'page')}>&gt;</li>
                </ul>
            </div >
        </>
    );
}

export default Pagination;
